import React, { useState, useEffect } from "react";
import axios from "axios";

import Navbar from "./Navbar";
import { getStorage, ref, uploadBytesResumable, getDownloadURL } from "firebase/storage";
import app from '../firebase';
import videoF from "../../src/pictures-olive/vi.mp4";

function Dplot() {
  const [video, setVideo] = useState(undefined);
  const [videoPerc, setVideoPerc] = useState(0);
  const [inputs, setInputs] = useState({});
  const [processedVideoData, setProcessedVideoData] = useState(null);

  useEffect(() => {
    video && uploadFile(video);
  }, [video]);

  const uploadFile = (file) => {
    const storage = getStorage(app);
    const fileName = new Date().getTime() + file.name;
    const storageRef = ref(storage, fileName);
    const uploadTask = uploadBytesResumable(storageRef, file);

    uploadTask.on(
      "state_changed",
      (snapshot) => {
        const progress = (snapshot.bytesTransferred / snapshot.totalBytes) * 100;
        setVideoPerc(Math.round(progress));
        console.log(`Upload progress: ${Math.round(progress)}%`);
        switch (snapshot.state) {
          case "paused":
            console.log("Upload is paused");
            break;
          case "running":
            console.log("Upload is running");
            break;
          default:
            break;
        }
      },
      (error) => {
        console.log("Upload error:", error);
      },
      () => {
        getDownloadURL(uploadTask.snapshot.ref).then((downloadURL) => {
          console.log('DownloadURL - ', downloadURL);
          setInputs((prev) => {
            return {
              ...prev,
              downloadURL,
            };
          });
        });
      }
    );
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post(`http://127.0.0.1:5000/api/videos`, { ...inputs });
      console.log('Video uploaded successfully');
      // window.location.reload();
    } catch (error) {
      console.log("Error uploading video:", error);
    }
  };

  const handleFetchProcessedVideo = async () => {
    try {
      const response = await axios.get(`http://127.0.0.1:5000/api/output-video`, { responseType: 'arraybuffer' });
      console.log("Response:", response); // Log the entire response object

      // Convert array buffer to base64
      const base64Video = btoa(
        new Uint8Array(response.data).reduce((data, byte) => data + String.fromCharCode(byte), '')
      );
      setProcessedVideoData(base64Video); // Set the processed video data
    } catch (error) {
      console.log("Error fetching processed video:", error);
    }
  };

  return (
    <div className="bg-black h-full">
      <Navbar />
      <div className="relative w-full h-[950px] py-20">
        <video autoPlay loop muted id="video" className="w-full h-[700px]">
          <source src={videoF} type="video/mp4" />
        </video>

        <div className="upload bg-black text-white mt-20 w-full md:h-[600px] sm:h-[800px] pt-5 text-white flex flex-col items-center">
          <form onSubmit={handleSubmit}>
            <label htmlFor="video">Video:</label>
            {videoPerc > 0 && "Uploading: " + videoPerc + "%"}
            <br />
            <input
              type="file"
              accept="video/*"
              id="video"
              onChange={(e) => setVideo(e.target.files[0])}
            />
            <br />

            <button
              type="submit"
              className="font-large texl-3xl hover:scale-110 my-20 p-4 hover:bg-[#F1F8FF] hover:scale-110 rounded-full hover:text-black border-white border-3"
              style={{ width: '200px' }}
            >
              Upload
            </button>
          </form>

          <br />
          <button
            onClick={handleFetchProcessedVideo}
            className="font-large texl-3xl hover:scale-110 mt mb-10 p-4 hover:bg-[#F1F8FF] hover:scale-110 rounded-full hover:text-black border-white border-3 justify-center mr-20"
            style={{ width: '200px' }}
          >
            Fetch Processed Video
          </button>
          <br />

          {processedVideoData && (
            <video controls className="w-full h-[400px]">
              <source src={`data:video/mp4;base64,${processedVideoData}`} type="video/mp4" />
              Your browser does not support the video tag.
            </video>
          )}
        </div>
      </div>
    </div>
  );
}

export default Dplot;
